import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <div className="navbar bg-gray-300 flex justify-between items-center p-4 shadow-lg">
      <h1 className="logo text-xl font-bold">
        <Link to="/">Pitch Crest</Link>
      </h1>
      <ul className="links flex space-x-4">
        <li><Link to="/home" className="text-blue-500">Home</Link></li>
        <li><Link to="/about" className="text-blue-500">About Us</Link></li>
        <li><Link to="/contact" className="text-blue-500">Contact</Link></li>
        <li><Link to="/signup" className="text-blue-500">Sign up</Link></li>
        <li><Link to="/login" className="text-blue-500">Login</Link></li>
      </ul>
    </div>
  );
}

export default Navbar;
